body{
    display: flex;
    flex-direction: column;
    justify-content: flex-start;
    gap: 10px;

    .container-1{
        display: flex;
        flex-direction: row;
        gap: 20px;
        --color: #FF1818;
        .color-box-text {
            color:rgb(195, 201, 219)
        }
    }

    .container-2{
        display: flex;
        flex-direction: row;
        gap: 20px;
        --color: #060EF5;
        .color-box-text {
            color:rgb(167, 164, 164)
        }
    }

    .container-3{
        display: flex;
        flex-direction: row;
        gap: 20px;
        --color: #1EBC0B;
        .color-box-text {
            color:rgb(99, 95, 95)
        }
    }

    .box {
        padding: 30px;

        &.base-color {
            background-color: var(--color);
            .color-box-text {
                color: white
            }
        }

        &.darken-1 {
            background-color: var(--color);
            filter: brightness(0.85);
        }
        &.darken-2 {
            background-color: var(--color);
            filter: brightness(0.75);
        }
        &.darken-3 {
            background-color: var(--color);
            filter: brightness(0.55);
        }
        &.darken-4 {
            background-color: var(--color);
            filter: brightness(0.45);
        }
        &.lighten-1 {
            background-color: var(--color);
            filter: brightness(3.5);
        }
        &.lighten-2 {
            background-color: var(--color);
            filter: brightness(4.5);
        }
        &.lighten-3 {
            background-color: var(--color);
            filter: brightness(5.5);
        }
        &.lighten-4 {
